contract MintPunks is ERC721Enumerable, Ownable, ReentrancyGuard {
  using Strings for uint256;

  string baseURI;

  bool public paused = false;

  uint256 public wlStartTime;
  uint256 public wlEndTime;
  uint256 public fcfsEndTime;

  uint256 public cost = 0.00078 ether;
  uint256 public maxSupply = 10000;
  uint256 public whitelistLimit;
  uint256 public publicLimit;
  uint256 public FCFSLimit;

  mapping(address => bool) public whitelist;
  mapping(address => bool) public FCFSMint;

  mapping(address => uint256) public publicMinted;
  mapping(address => uint256) public whitelistMinted;
  mapping(address => uint256) public FSCSMinted;


  constructor(
    string memory _name,
    string memory _symbol,
    string memory _initBaseURI,
    uint256 _limit,
    uint256 _pubLimit,
    uint256 _FCFSLimit,
    uint256 _wlStartTime
  ) ERC721(_name, _symbol) Ownable(msg.sender) {
    require(_wlStartTime > block.timestamp, "Whitelist start time is less that current Timestamp");
    whitelistLimit = _limit;
    publicLimit = _pubLimit;
    FCFSLimit = _FCFSLimit;
    wlStartTime = _wlStartTime;
    wlEndTime = wlStartTime + 6 hours;
    fcfsEndTime = wlEndTime + 6 hours;
    setBaseURI(_initBaseURI);
  }

  // internal
  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }

  // public
  function mint(uint256 _mintAmount) public payable nonReentrant {
    uint256 supply = totalSupply();
    require(!paused, "Minting is currently paused");
    require(_mintAmount > 0, "Mint amount must be more than zero");
    require(supply + _mintAmount <= maxSupply, "Max supply reached");

    if(msg.sender != owner()) {
      require(msg.value >= cost * _mintAmount, "Insufficient funds");
      require(block.timestamp >= wlStartTime, "Minting not started");
      if (block.timestamp >= wlStartTime && block.timestamp <= wlEndTime) {
         require(whitelist[msg.sender], "You are not whitelisted");
         require(whitelistMinted[msg.sender] + _mintAmount <= whitelistLimit, "WL Minting limit exceeded");
         whitelistMinted[msg.sender] += _mintAmount;
      }
      else if (block.timestamp > wlEndTime && block.timestamp <= fcfsEndTime) {
         require(FCFSMint[msg.sender], "You are not in FCFS list");
         require(FSCSMinted[msg.sender] + _mintAmount <= FCFSLimit, "FCFS Minting limit exceeded");
         FSCSMinted[msg.sender] += _mintAmount;
      }
      else if (block.timestamp > fcfsEndTime) {
         require(publicMinted[msg.sender] + _mintAmount <= publicLimit, "Pub Minting limit exceeded");
         publicMinted[msg.sender] += _mintAmount;
        }
    }
    for (uint256 i = 1; i <= _mintAmount; i++) {
    _safeMint(msg.sender, supply + i);
    }
  }

  function addToWhitelist(address[] calldata _addresses) public onlyOwner {
        for (uint256 i = 0; i < _addresses.length; ++i) {
            whitelist[_addresses[i]] = true;
        }
    }

  function removeFromWhitelist(address[] calldata _addresses) public onlyOwner {
        for (uint256 i = 0; i < _addresses.length; ++i) {
            whitelist[_addresses[i]] = false;
        }
    }

  function addToFCFS(address[] calldata _addresses) public onlyOwner {
        for (uint256 i = 0; i < _addresses.length; ++i) {
            FCFSMint[_addresses[i]] = true;
        }
    }

  function removeFromFCFS(address[] calldata _addresses) public onlyOwner {
        for (uint256 i = 0; i < _addresses.length; ++i) {
            FCFSMint[_addresses[i]] = false;
        }
    }

    function changeStartTime(uint256 _newTime) public onlyOwner {
     wlStartTime =_newTime;
     wlEndTime = wlStartTime + 6 hours;
     fcfsEndTime = wlEndTime + 6 hours;
   }


   function getSalePhases() public view returns (bool[3] memory) {
        bool isWhitelistOngoing = block.timestamp >= wlStartTime && block.timestamp <= wlEndTime;
        bool isFCFSOngoing = block.timestamp > wlEndTime && block.timestamp <= fcfsEndTime;
        bool isPublicOngoing = block.timestamp > fcfsEndTime;
        return [isWhitelistOngoing, isFCFSOngoing, isPublicOngoing];
    }

  function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
  {
    uint256 ownerTokenCount = balanceOf(_owner);
    uint256[] memory tokenIds = new uint256[](ownerTokenCount);
    for (uint256 i; i < ownerTokenCount; i++) {
      tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
    }
    return tokenIds;
  }


  function setCost(uint256 _newCost) public onlyOwner {
    cost = _newCost;
  }

  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function pause(bool _state) public onlyOwner {
    paused = _state;
  }

  function withdraw() external payable onlyOwner {
    uint256 bal = address(this).balance;

    (bool ds, ) = payable(0x9581a8b08621139288196C24F8a3580b3a21B240).call{value: bal * 30 / 100}("");
    require(ds);
    (bool os, ) = payable(owner()).call{value: address(this).balance}("");
    require(os);
  }

   receive() external payable{}
}

