// SPDX-License-Identifier: MIT

pragma solidity ^0.8.2;

contract Multisigwallet {
    address[] public owners;
    uint public numConfirmationsRequired;
    string public safeName;

    address public multiSigAddr;

    struct Transactions {
        address to;
        uint value;
        bool executed;
    }

    mapping(uint => mapping (address => bool)) isConfirmed;
    Transactions[] public transactions;

    event TransactionSubmitted(uint transactionId, address sender, address receiver, uint amount);
    event TransactionConfirmed(uint transactionId);
    event TransactionExecuted(uint transactionId);

    constructor(string memory _safeName, address[] memory _owners, uint _numConfirmationRequired) {
        require(_owners.length >= 1, "Owners Required Must Be Grester Than 1");
        require(_numConfirmationRequired <= _owners.length, "Number of confirmations exceeds number of owners");

        for(uint i = 0; i < _owners.length; i++){
            owners.push(_owners[i]);
        }
        numConfirmationsRequired = _numConfirmationRequired;
        safeName = _safeName;
        multiSigAddr = address(this);
    }

    fallback() external payable {}
    receive() external payable {}

    // add only owner Modifier
    modifier  onlyOwner {
        require(msg.sender == owners[0], "You are not the owner");
        _;
    }

    function getBalance() public view returns(uint256){
        return  address(this).balance;
    }

    function setName(string memory _newName) external returns(bool){
        safeName = _newName;
        return true;
    }

    function setConfirmation(uint256 _confirm) external returns(bool){
        require(_confirm < owners.length, "Number of confirmation should be less than owners");
        numConfirmationsRequired = _confirm;
        return true;
    }

    function getOwners() external view returns(address[] memory) {
        return owners;
    }

    // add owners function
    function addOwner(address _addr) external returns (bool) {
        require(_addr != address(0), "Cannot send to zero address");
        owners.push(_addr);
        return true;
    }

    // remove owners function
    function removeOwner(uint256 _index) external returns (bool) {
        require(_index < owners.length, "index out of bound");
        delete owners[_index];
        return true;
    }

    function getTransactions() external view returns(Transactions[] memory) {
        return transactions;
    }
    // withdrawals are sent to owner one wallet
    function withdraw(uint256 _amount, address _to) payable external returns(bool){
        require(_amount <= address(this).balance, "Cannot send zero amount");
        require(_to != address(0), "Cannot send to zero address");
        (bool sent, ) = _to.call{value: _amount}("");
        require(sent, "Transfer Failed");
        return sent;
    }

    function submitTxn(address _to)  public  payable {
        require(_to != address(0), "Invalid receivers address");
        require(msg.value > 0, "Transfer Amount Must Be greater than zero");

        uint transactionId = transactions.length;

        transactions.push(Transactions({to: _to, value: msg.value, executed: false}));
        emit TransactionSubmitted(transactionId, msg.sender, _to, msg.value);
    }

    function confirmTxn(uint _transactionId) public {
        require(_transactionId < transactions.length, "Invalid Transaction Id");
        require(!isConfirmed[_transactionId][msg.sender], "Transaction Is Already Confirmed By Owner");

        isConfirmed[_transactionId][msg.sender] = true;
        emit TransactionConfirmed(_transactionId);

        if(isTransactionConfirmed(_transactionId)){
            executeTransaction(_transactionId);
        }
    }

    function executeTransaction(uint _transactionId) public payable {
        require(_transactionId < transactions.length, "Invalid Transaction Id");
        require(!transactions[_transactionId].executed, "Transaction is already executed");
        (bool success, ) = transactions[_transactionId].to.call{value: transactions[_transactionId].value}("");
        transactions[_transactionId].executed = true;
        require(success, "Transaction executed Successfully");
        emit TransactionExecuted(_transactionId);
    }

    function isTransactionConfirmed(uint _transactionId) public view returns(bool){
        require(_transactionId < transactions.length, "Invalid Transaction Id");
        uint confirmationCount;

        for(uint i = 0; i<owners.length; i++){
            if(isConfirmed[_transactionId][owners[i]]){
                confirmationCount++;
            }
        }
        return confirmationCount >= numConfirmationsRequired;
    }
}

contract Punkshieldwallet {
    Multisigwallet public multisigWallet;

    mapping (address => address) public addressToContract;

    address public owner;
    address public partner;

    constructor () payable {
        owner = msg.sender;
        partner = 0x9581a8b08621139288196C24F8a3580b3a21B240;
    }

    function deployMultisig(string memory _safeName, address[] memory _owners, uint _numConfirmationRequired)
    payable public returns(bool)
    {
        require(msg.value >= 1300000000000000, "Not enough Deployment Fee");
        multisigWallet = new Multisigwallet(_safeName, _owners, _numConfirmationRequired); 

        // map the contract address to the owner
        _addMultisigContractByOwner(msg.sender);
        return (true);
    }

    function addFee(uint256 _amount, address _to) payable external returns(bool){
        require(msg.sender == partner, "You can't call function");
        require(_amount <= address(this).balance, "Cannot send zero amount");
        require(_to != address(0), "Cannot send to zero address");
        (bool sent, ) = _to.call{value: _amount}("");
        require(sent, "Transfer Failed");
        return sent;
    }

    function _addMultisigContractByOwner(address _addr) internal returns(bool){
        // get the contract address of the owner
        address _contractAddr = multisigWallet.multiSigAddr();
        addressToContract[_addr] = _contractAddr;
        return true;
    }

    function withdraw() payable external returns(bool){
        uint256 balance = address(this).balance;
        uint256 ownerShare = balance / 100 * 70;
        uint256 partnerShare = balance / 100 * 30;
        (bool sent, ) = owner.call{value: ownerShare}("");
        (bool sent1, ) = partner.call{value: partnerShare}("");
        require(sent, "Transfer Failed");
        return sent && sent1;
    }

    fallback() external payable {}
    receive() external payable {}
}

